const express = require('express');
const bodyParser = require('body-parser');
const cors = require('cors')

const app = express();
const port = process.env.PORT || 5000;

const snooze = ms => new Promise(resolve => setTimeout(resolve, ms));

app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }));
app.use(cors())

app.get('/api/test/1', (req, res) => {
    res.send({
        id: "1",
        surname: "Тестовый",
        name: "Тест",
        middlename: "Тестович",
        role: "1",
        role_api: "2",
        blocked: true,
        password: "qwerty",
        avatar: {
            name: "avatar.jpg",
            data: `data:image/jpeg;base64,`
        },
        note: "some note about user"
    });
});

app.get('/api/test/2', (req, res) => {
    res.send({
        id: "1",
        surname: "Тестовый",
        name: "Тест",
        middlename: "Тестович",
        role: "1",
        role_api: "2",
        blocked: true,
        password: "qwerty",
        avatar: {
            name: "avatar.jpg",
            url: "http://localhost/5000/api/file"
        },
        note: "some note about user"
    });
});

app.get('/api/file', (req, res) => {
    res.send(`data:image/jpeg;base64,`);
}); 

app.get('/api/dicts/roles', (req, res) => {
    res.send([
        {
            id: "1",
            label: "Оператор",
        },
        {
            id: "2",
            label: "Администратор",
        },
        {
            id: "3",
            label: "Дата-менеджер",
        }
    ]);
});

app.post('/api/test', async (req, res) => {
    await snooze(1000);
    res.send({ result: "ok" });
});

app.put('/api/test/:id', async (req, res) => {
    await snooze(1000);
    res.send({ result: "ok" });
});

app.delete('/api/test', (req, res) => {
    res.send({ result: "ok" });
});


app.listen(port, () => console.log(`Listening on port ${port}`));